INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 0, 106001, "2015/12/17 15:00:00", 0.0, "キャル", 7001, 1, 7, 0.0, 0, -363.0, 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 0, 105901, "2015/12/17 15:00:00", 0.0, "コッコロ", 7002, 1, 7, 0.0, 0, -363.0, 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 0, 105801, "2015/12/17 15:00:00", 0.0, "ペコリーヌ", 7003, 1, 7, 0.0, 0, -363.0, 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("ジュエルを食べ物…\nいえ、貴重品と交換できます！", 0, 105801, "2015/12/17 15:00:00", 0.0, "ペコリーヌ", 10001, 1, 10, 0.0, 0, -363.0, 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 0, 106001, "2015/12/17 15:00:00", 0.0, "キャル", 10002, 1, 10, 0.0, 0, -363.0, 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 0, 105901, "2015/12/17 15:00:00", 0.0, "コッコロ", 10003, 1, 10, 0.0, 0, -363.0, 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 2104010, 106401, "2015/12/17 15:00:00", 0.0, "シェフィ", 10004, 1, 10, 0.0, 0, -363.0, 1, 2, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 0, 105801, "2015/12/17 15:00:00", 0.0, "ペコリーヌ", 12001, 1, 12, 0.0, 0, -416.5, 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 0, 106001, "2015/12/17 15:00:00", 0.0, "キャル", 13001, 1, 13, 0.0, 0, -363.0, 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 0, 105901, "2015/12/17 15:00:00", 0.0, "コッコロ", 13002, 1, 13, 0.0, 0, -363.0, 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 2104010, 106401, "2015/12/17 15:00:00", 0.0, "シェフィ", 13003, 1, 13, 0.0, 0, -363.0, 1, 2, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 0, 105801, "2015/12/17 15:00:00", 0.0, "ペコリーヌ", 13004, 1, 13, 0.0, 0, -363.0, 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 0, 105901, "2015/12/17 15:00:00", 0.0, "コッコロ", 14001, 1, 14, 0.0, 0, -363.0, 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 2104010, 106401, "2015/12/17 15:00:00", 0.0, "シェフィ", 14002, 1, 14, 0.0, 0, -363.0, 1, 2, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 0, 105801, "2015/12/17 15:00:00", 0.0, "ペコリーヌ", 14003, 1, 14, 0.0, 0, -363.0, 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 0, 106001, "2015/12/17 15:00:00", 0.0, "キャル", 14004, 1, 14, 0.0, 0, -363.0, 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 0, 105901, "2015/12/17 15:00:00", 0.0, "コッコロ", 15001, 1, 15, 0.0, 0, -470.0, 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 2104010, 106401, "2015/12/17 15:00:00", 0.0, "シェフィ", 16001, 1, 16, 0.0, 0, -363.0, 1, 2, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 0, 105801, "2015/12/17 15:00:00", 0.0, "ペコリーヌ", 16002, 1, 16, 0.0, 0, -363.0, 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 0, 106001, "2015/12/17 15:00:00", 0.0, "キャル", 16003, 1, 16, 0.0, 0, -363.0, 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 0, 105901, "2015/12/17 15:00:00", 0.0, "コッコロ", 16004, 1, 16, 0.0, 0, -363.0, 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES (" こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 0, 105901, "2015/12/17 15:00:00", 0.0, "コッコロ", 17002, 1, 17, 0.0, 0, -363.0, 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 0, 106001, "2015/12/17 15:00:00", 0.0, "キャル", 17004, 1, 25, 0.0, 0, -363.0, 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 0, 105901, "2015/12/17 15:00:00", 0.0, "コッコロ", 17005, 1, 25, 0.0, 0, -363.0, 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 2104010, 106401, "2015/12/17 15:00:00", 0.0, "シェフィ", 17006, 1, 25, 0.0, 0, -363.0, 1, 2, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 0, 105801, "2015/12/17 15:00:00", 0.0, "ペコリーヌ", 17007, 1, 25, 0.0, 0, -363.0, 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 0, 190801, "2015/12/17 15:00:00", 0.0, "カリン", 18001, 1, 18, 0.0, 0, -363.0, 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 0, 190801, "2015/12/17 15:00:00", 0.0, "カリン", 18002, 1, 18, 0.0, 0, -363.0, 2, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 0, 190801, "2015/12/17 15:00:00", 0.0, "カリン", 19001, 1, 19, 0.0, 0, -470.0, 3, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 0, 190801, "2015/12/17 15:00:00", 0.0, "カリン", 19002, 1, 19, 0.0, 0, -470.0, 4, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 0, 190801, "2015/12/17 15:00:00", 0.0, "カリン", 20001, 1, 20, 0.0, 0, -470.0, 5, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 0, 190801, "2015/12/17 15:00:00", 0.0, "カリン", 20002, 1, 20, 0.0, 0, -470.0, 6, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 0, 106001, "2015/12/17 15:00:00", 0.0, "キャル", 21001, 1, 21, 0.0, 0, -363.0, 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 0, 105901, "2015/12/17 15:00:00", 0.0, "コッコロ", 21002, 1, 21, 0.0, 0, -363.0, 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 2104010, 106401, "2015/12/17 15:00:00", 0.0, "シェフィ", 21003, 1, 21, 0.0, 0, -363.0, 1, 2, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 0, 105801, "2015/12/17 15:00:00", 0.0, "ペコリーヌ", 21004, 1, 21, 0.0, 0, -363.0, 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 0, 190801, "2015/12/17 15:00:00", 0.0, "カリン", 22001, 1, 22, 0.0, 0, -430.0, 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 0, 190801, "2015/12/17 15:00:00", 0.0, "カリン", 22002, 1, 22, 0.0, 0, -430.0, 2, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 0, 190801, "2015/12/17 15:00:00", 0.0, "カリン", 23001, 1, 23, 0.0, 0, -430.0, 3, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 0, 190801, "2015/12/17 15:00:00", 0.0, "カリン", 23002, 1, 23, 0.0, 0, -430.0, 4, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 0, 109001, "2019/01/31 12:00:00", 4.08, "エリコ（バレンタイン）", 24001, 2, 24, 8.0, 10011, -385.0, 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 0, 109001, "2019/01/31 12:00:00", 5.0, "エリコ（バレンタイン）", 24002, 2, 24, 8.0, 10011, -385.0, 2, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 0, 109001, "2019/01/31 12:00:00", 10.11, "エリコ（バレンタイン）", 24003, 2, 24, 8.0, 10011, -385.0, 3, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 0, 109001, "2019/01/31 12:00:00", 4.0, "エリコ（バレンタイン）", 24004, 2, 24, 8.0, 10011, -385.0, 4, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 0, 109001, "2019/01/31 12:00:00", 6.0, "エリコ（バレンタイン）", 24005, 2, 24, 8.0, 10011, -385.0, 5, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 0, 109002, "2019/01/31 12:00:00", 0.0, "エリコ（バレンタイン）", 24006, 1, 24, 0.0, 10011, 0.0, 6, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 0, 109002, "2019/01/31 12:00:00", 0.0, "エリコ（バレンタイン）", 24007, 1, 24, 0.0, 10011, 0.0, 7, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 0, 109002, "2019/01/31 12:00:00", 0.0, "エリコ（バレンタイン）", 24008, 1, 24, 0.0, 10011, 0.0, 8, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 0, 109002, "2019/01/31 12:00:00", 0.0, "エリコ（バレンタイン）", 24009, 1, 24, 0.0, 10011, 0.0, 9, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 0, 109002, "2019/01/31 12:00:00", 0.0, "エリコ（バレンタイン）", 24010, 1, 24, 0.0, 10011, 0.0, 10, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 0, 109101, "2019/01/31 12:00:00", 2.12, "シズル（バレンタイン）", 24011, 2, 24, 8.0, 10011, -385.0, 1, 1, "2030/12/17 14:59:59");
INSERT INTO `v1_bd7bf6e220bd2598118016278330baf21d46c94f1807b908ab403231a1296a3f` VALUES ("うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 0, 109101, "2019/01/31 12:00:00", 4.19, "シズル（バレンタイン）", 24012, 2, 24, 8.0, 10011, -385.0, 2, 5, "2030/12/17 14:59:59");
